import React, { useState } from 'react';
import Header from './components/Header';
import UserInput from './components/UserInput';
import Options from './components/Options';
import StartMeditationButton from './components/StartMeditationButton';

const App = () => {
  const [inputValue, setInputValue] = useState('');
  const [selectedOptions, setSelectedOptions] = useState({});

  const handleInputChange = (e) => setInputValue(e.target.value);

  const handleOptionClick = (name, option) => setSelectedOptions({ ...selectedOptions, [name]: option });

  const handleStartMeditation = () => alert(JSON.stringify(selectedOptions));

  return (
    <div className="App">
      <Header />
      <UserInput handleOnChange={handleInputChange} value={inputValue} />
      <Options handleOnClick={handleOptionClick} />
      <StartMeditationButton handleOnClick={handleStartMeditation} />
    </div>
  );
};

export default App;
